import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import ShopPerformance from './components/ShopPerformance';
import CreatorPerformance from './components/CreatorPerformance';

const App = () => {
  return (
    <Router>
      <div>
        <h1>HiveHQ Dashboard</h1>
        <Switch>
          <Route path="/" exact component={Dashboard} />
          <Route path="/shop-performance" component={ShopPerformance} />
          <Route path="/creator-performance" component={CreatorPerformance} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
